import React from "react";
import "./layout.css";

const LevelLayout = ({ title }) => {
  return (
    <div>
      <div className="container">
        <div className="content">
          <h1>{title}</h1>
        </div>
      </div>
      {/* <div className="content">{children}</div> */}
    </div>
  );
};

export default LevelLayout;
